import React, {Component} from 'react';

class ReceiptContainer extends Component {
  constructor(props){
    super(props);
    this.state = {
      items:[
        {
          id:1,
          name: "Chateaubriand" ,
          price: 25
        },{
          id:2,
          name: "Pizza",
          price: 9
        },{
          id:3,
          name: "Baked Alaska",
          price: 8
        },{
          id:4,
          name: "Coke",
          price: 3
        },{
          id:5,
          name: "Sparkling Water",
          price: 2
        },
      ]}
};

render(){
  return(
    <>
    <ReceiptList data={this.state.data}/>
    </>
  );
};
};

export default ReceiptContainer;
